import React from 'react'
import styled from 'styled-components'

const ThemeTogglerElement = styled.button`
  padding: .5rem 2rem;
  border-radius: 100px;
  border: 0;
  outline: 0;
  background: ${props => props.theme.complement};
  color: ${props => props.theme.base}
`

export default function ThemeToggler (props) {
  return (
    <ThemeTogglerElement>
      I toggle themes
    </ThemeTogglerElement>
  )
}
